{"post_stream":{"posts":[{"id":3317862,"name":"","username":"kestrel","avatar_template":"/letter_avatar_proxy/v4/letter/k/67e7ee/{size}.png","created_at":"2024-02-26T16:10:20.430Z","cooked":"<p>We’re having some trouble with controlling motors in a command-based robot. When doing something like this, where <code>m_drive</code> is a <code>CANSparkMax</code> controller:</p>
<pre data-code-wrap="java"><code class="lang-java">setDefaultCommand(Commands.run(() -&gt; m_drive.set(1.0)));
</code></pre>
<p>We are having issues where this line floods the <span class="abbreviation">CAN<template class="tooltiptext" data-text="Controller Area Network"></template></span> bus, leading to timeout errors.</p>
<p>We were thinking about something like this:</p>
<pre data-code-wrap="java"><code class="lang-java">setDefaultCommand(Commands.runOnce(() -&gt; m_drive.set(1.0)));
</code></pre>
<p>Does the <code>InstantCommand</code> get run every time the default command is scheduled, or is it only run a single time ever?</p>
